import React from 'react'

const Question = (props) => {
  return (
    <div className='faq inline-flex' >
      <h1 className='circle-no grid items-center'>{props.no}</h1>
      <h2>{props.ques}</h2>
      {/* <p>{props.ans}</p> */}
    </div>
  )
}

export default Question;
